    const css = {
        body : {
            width: '100%',
            height: '50px',

            fontSize: '16px',
        },
        text : {
            width: '80%'
        }



    }







    if (props.type === 'text') {
        return (
            <div style={css.body}>
                <text style={css.text}>{props.text}</text>



            </div>
        )
    } else if (props.type === 'photoRight') {
        return (
            <div style={css.body}>




            </div>
        )
    } else if (props.type === 'photoLeft') {
        return (
            <div style={css.body}>




            </div>
        )
    } else {
        console.log('ERROR')
    }

}

